#include <iostream>
#include <algorithm>

using std::string;


class Solution {
public:
    char findTheDifference(string s, string t) {
        std::sort(s.begin(), s.end());
        std::sort(t.begin(), t.end());

        auto originalIter = s.begin();
        auto originalRevIter = s.rbegin();

        auto shuffledIter = t.begin();
        auto shuffledRevIter = t.rbegin();

        while (true) {
            if (*originalIter != *shuffledIter)
                return *shuffledIter;
            ++originalIter;
            ++shuffledIter;


            if (*originalRevIter != *shuffledRevIter)
                return *shuffledRevIter;
            ++originalRevIter;
            ++shuffledRevIter;
        }
    }
};


int main() {
    Solution s;

    std::cout << s.findTheDifference(
        "",
        ""
        );
    return 0;
}
